(1, 44, 'Backhoe Loader, 60 hp', 'Digging depth up to 14\'8\"\r\nLift capacity up to 6803 lbs\r\nTravel speed up to 24.6 mph', 1, 'HC12138193', '30000.00', 2, 'Available', ),
(2, 44, 'Dozer, 70 hp', 'Our 500 to 5000 ft.-lb. hammers are ideally suited for road repair, concrete demolition and site preparation. 3000-5000 ft.-lb. hammers are suited for bridge-work, rock miningfoundation removal, and other major demolition tasks. Dust intake prevention systems improve the life of the piston, working steel and bushing. Adjustable stroke lengths varies the impact energy per blow, allowing the operator to match the carrier to the work at hand. FRD/Kent offers multiple attachment configurations to make it fast and easy for use on mini-excavators, skid steer loaders or backhoes.\r\n\r\nStandard, Wide and LGP (Low Ground Pressure) Track models available\r\nSuperior, unrestricted visibility of the blade\r\nAutomatic parking brake for enhanced safety', 1, 'HC12138195', '20000.00', 3, 'Available', ),
(3, 44, 'Carry Deck Crane, 8.5-9 Ton', 'Carry Deck Crane, 8.5-9 Ton\r\nWhether you are installing signs, rooftop air conditioners, building trusses, or lifting material to the next level of your building project, United Rentals has a mobile truck crane to fit your needs. Do you have several projects going at once? Don?t rent one crane for each project, just rent one highway legal truck crane and use it at all of your sites. Call for specific load and angle information.\r\nFully hydraulic controls for smooth, precise operation\r\nTight turning radius provides great jobsite maneuverability\r\nEasy to operate\r\n', 1, 'HC12138198', '40000.00', 5, 'Available', );
INSERT INTO `equipments` (`equipId`, `spid`, `equipName`, `equipDesc`, `manufacId`, `equipEngineNumber`, `equipPrice`, `categoryId`, `equipStatus`, `equipimage`) VALUES
(4, 44, 'Excavator, 25,000-29,000 lbs', 'United Rentals features John Deere excavators with easy-to-use Powersize engine/hydraulic management that maximizes engine output and saves fuel by keeping a constant balance between pressure and flow.Deere excavators are easy to control in multiple function applications like precision grading. Just punch in the grading mode and smoothly boom-out while you begin to propel across the top of the embankment. Next keep propelling while you boom-up, arm-in, and curl the bucket. Cab features low noise, great visibility, heater, ventilation, AM/FM radio, and vibration cushioned seat. Bucket clamps, clearing rakes, ditching buckets, grapples, and hydraulic hammers are available. Excavators larger than 45,000 lbs. are also available from United Rentals Heavy Machinery Division and select General Rental locations.\r\nExcellent all-around visability\r\nComfortable, climate controlled operator cab\r\nEasy-to-use joystick controls\r\n', 1, 'HC12138190', '50000.00', 7, 'Available', ),
(5, 44, 'Mini Excavator, 7000-9999 lbs', 'The compact size and offset digging capability of United Rentals mini-excavators makes them well suited for close working conditions. Low weight permits use on jobsites with weight restrictions and for interior demolition. Multi-function hydraulics let you use several functions at the same time for fast cycle times and greater productivity. Independent boom swing permits offset digging around obstacles and beside structures. Straight travel feature lets you use any excavator function while traveling and maintain a straight course. Backfill blade allows the excavator to backfill a trench or grade a jobsite. The Takeuchi TB108 is retractable and can fit through most doorways and backyard gates. Buckets from 9\" to 36\" are available. Hydraulic breakers, augers, grapples, and thumbs are also available. These machines can be transported with a pickup truck and small trailer. Rubber tracks are standard.\r\nSafely transportable by pickup or trailer\r\nEasy-to-use joystick controls\r\nMulti-function hydraulics for fast cycle times and greater productivity\r\nBackfill blade doubles as a stabiliz', 1, 'HC12138194', '25000.00', 7, 'Available', );

